import React from 'react';
import styled from 'styled-components';

class Button extends React.Component {
  render() {
      const { btnText, btnStyle } = this.props;

      const Button = styled.button`
        height: 45px;
      `;
    return (
        <Button>{btnText}</Button>
    )
  }
};
export default Button;
